import styles from './Header.module.scss';

const Header = () => {
    return (
        <div>
            <header className={styles.header}>
                <h1>
                    create app
                </h1>
                <p>description</p>
            </header>
            <nav>
                <a href="#">One</a>
                <a href="#">Two</a>
                <a href="#">Three</a>
            </nav>
        </div> 
    );
}

export default Header;
